        e.preventDefault()
    }

    return (
        <>
            <h2>Cadastre seu e-mail.</h2>
            <form>
                <input type="email" placeholder="Digite seu e-mail..."></input>
                <button type="submit" onClick={enviarEmail}>Enviar e-mail</button>
            </form>
        </>
    );
}
